def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    group_axis = obj._get_axis(axis)

    if level is not None:
        if isinstance(group_axis, MultiIndex):
            if is_list_like(level) and len(level) == 1:
                level = level[0]

        if isinstance(level, str):
            if level not in obj.columns:
                raise ValueError(
                    "level name '{}' is not a column name".format(level)
                )
            key = obj[level]
            level = None

    if isinstance(key, BaseGrouper):
        return key, [], obj

    if not isinstance(key, (list, tuple)):
        key = [key]

    groupings = []

    for gpr in key:
        if gpr not in obj.columns:
            raise KeyError(gpr)

        if is_categorical_dtype(obj[gpr]) and len(obj[gpr]) != obj.shape[axis]:
            raise ValueError(
                ("Length of grouper ({len_gpr}) and axis ({len_axis}) "
                "must be the same length").format(
                    len_gpr=len(obj[gpr]),
                    len_axis=obj.shape[axis]
                )
            )

        ping = Grouping(
            group_axis,
            obj[gpr],
            obj=obj,
            name=gpr,
            level=None,
            sort=sort,
            observed=observed,
            in_axis=True
        )

        groupings.append(ping)

    if len(groupings) == 0:
        raise ValueError("No group keys passed!")

    grouper = BaseGrouper(group_axis, groupings, sort=sort, mutated=mutated)
    return grouper, [], obj
